   return(
    <form >
        <label>nombre: </label>
        <input type='text' name='name' value={nombre} onChange={e => setNombre(e.target.value)}/>
        <button type="submit">Enviar</button>
        <p> valor: {nombre}</p>
    </form>
   )
}
